import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="container shadow p-3 bg-white">
      {/* Header section */}
      <div className="d-flex justify-contents-between align-items-center">
        <h1 className='text-danger'>Densir <br/>
        Tech</h1>

        {/* Navigation links */}
        <ul className="d-flex list-unstyled gap-4 ms-auto">
          <li><a href="#" className="text-decoration-none">Home</a></li>
          <li><a href="#" className="text-decoration-none">About</a></li>
          <li><a href="#" className="text-decoration-none">Services</a></li>
          <li><a href="#" className="text-decoration-none">Contacts</a></li>
          <Link to='/login' className='btn btn-success '>Login</Link>
        </ul>
      </div>
    </div>
  );
};

export default Navbar;
